import { Link } from "react-router-dom";
import { H1, Paragrafo } from "./homeSyled";


export default function Home() {
  //Vou ser uma função de home
  return (
    <div>
      <H1>SEU DESTINO É + ALÉM...</H1>
      <div>
        <div></div>
      <Paragrafo>Se inscreva para viagens espaciais, além 
        da nossa realiade</Paragrafo>
      <Paragrafo>E chegue ondem ninguém jamais imaginou chegar!</Paragrafo>
      <Link to='/all-trip'><button>Ver viagens disponíveis</button></Link>
      <Link to='/area-admin'><button>Área do Admin</button></Link>
      </div>
    </div>
  );
}
